
drop table if exists v2_equipment;
CREATE TABLE IF NOT EXISTS v2_equipment (
  EquipmentID varchar(50) NOT NULL,
  EquipmentName varchar(100),
  EquipmentType varchar(53),
  UseIndicator varchar(5)
);


drop table if exists v2_equipmentparameter;
CREATE TABLE IF NOT EXISTS v2_equipmentparameter (
  ParameterID varchar(128) NOT NULL DEFAULT '',
  ParameterName varchar(64) NOT NULL DEFAULT '',
  EquipmentID varchar(50) NOT NULL DEFAULT '',
  ParameterType varchar(32) NOT NULL DEFAULT '',
  ParameterGrade varchar(32) NOT NULL DEFAULT '',
  ParameterUOMCode varchar(32) NOT NULL DEFAULT '',
  LSL varchar(16) NOT NULL DEFAULT '',
  USL varchar(16) DEFAULT NULL,
  PeriodicDataCollectionIndicator varchar(32) NOT NULL DEFAULT '',
  DataCollectionPeriod varchar(32) NOT NULL DEFAULT ''
);


drop table if exists v2_equipmentparametervalue;
CREATE TABLE IF NOT EXISTS v2_equipmentparametervalue (
  ParameterID varchar(64) NOT NULL DEFAULT '',
  EquipmentID varchar(64) DEFAULT NULL,
  ParameterValue varchar(255) DEFAULT NULL,
  EventDateTime varchar(32) DEFAULT NULL,
  ValidationResultCode varchar(16) NOT NULL DEFAULT '',
  ParameterUOMCode varchar(16) NOT NULL DEFAULT ''
);


drop table if exists v2_operation;
CREATE TABLE IF NOT EXISTS v2_operation (
  OperationID varchar(64) NOT NULL,
  OperationName varchar(100) DEFAULT NULL,
  OperationType varchar(50) DEFAULT NULL,
  UseIndicator varchar(16) DEFAULT NULL
);


drop table if exists v2_operationparameter;
CREATE TABLE IF NOT EXISTS v2_operationparameter (
  ParameterID varchar(64) NOT NULL DEFAULT '',
  ParameterName varchar(128) NOT NULL DEFAULT '',
  OperationID varchar(64) NOT NULL DEFAULT '',
  ParameterType varchar(64) NOT NULL DEFAULT '',
  ParameterGrade varchar(16) NOT NULL DEFAULT '',
  ParameterUOMCode varchar(16) NOT NULL DEFAULT '',
  LSL varchar(32) NOT NULL DEFAULT '',
  USL varchar(32) DEFAULT NULL,
  PeriodicDataCollectionIndicator varchar(64) NOT NULL DEFAULT '',
  DataCollectionPeriod varchar(64) NOT NULL DEFAULT ''
);


drop table if exists v2_operationparametervalue;
CREATE TABLE IF NOT EXISTS v2_operationparametervalue (
  ParameterID varchar(64) NOT NULL DEFAULT '',
  OperationID varchar(64) NOT NULL DEFAULT '',
  ParameterValue text NOT NULL,
  EventDateTime varchar(32) DEFAULT NULL,
  ValidationResultCode varchar(16) NOT NULL DEFAULT '',
  ParameterUOMCode varchar(16) NOT NULL DEFAULT ''
);



drop table if exists v2_line;
CREATE TABLE IF NOT EXISTS v2_line (
  LineID varchar(64) NOT NULL,
  LineName varchar(64) NOT NULL,
  LineType varchar(32) NOT NULL,
  UseIndicator varchar(64) DEFAULT NULL,
  LocationID varchar(64) NOT NULL,
  PlantID varchar(64) NOT NULL,
  SiteID varchar(64) NOT NULL,
  EnterpriseID varchar(64) NOT NULL,
  LineStatus varchar(16) DEFAULT NULL
);



drop table if exists V2_LINE_BOM;
CREATE TABLE IF NOT EXISTS V2_LINE_BOM (
  BOMID varchar(64) DEFAULT NULL,
  BOMType varchar(32) NOT NULL,
  ItemID varchar(64) NOT NULL,
  BOMQuantity varchar(16) NOT NULL,
  ItemUOMCode varchar(16) NOT NULL,
  ChildItemID char(64) NOT NULL,
  ChildItemUOMCode char(16) NOT NULL,
  ActualRequirementQuantity char(16) NOT NULL,
  BOMRevisionNumber char(16) NOT NULL,
  ValidStartDateTime varchar(32) DEFAULT NULL,
  ValidEndDateTime varchar(32) DEFAULT NULL,
  RoutingID varchar(64) DEFAULT NULL,
  OperationSequence char(16) NOT NULL,
  BackFlushedIndicator varchar(16) NOT NULL
);



drop table if exists V2_LINE_ITEMMASTER;
CREATE TABLE IF NOT EXISTS V2_LINE_ITEMMASTER (
  ItemID varchar(64) NOT NULL,
  ItemType varchar(32) NOT NULL,
  ItemName varchar(64) DEFAULT NULL,
  ItemLargeClass varchar(16) NOT NULL,
  ItemMediumClass varchar(16) NOT NULL,
  ItemSmallClass varchar(16) NOT NULL,
  UseIndicator varchar(16) NOT NULL,
  ItemUOMCode varchar(16) NOT NULL,
  ItemSpecification varchar(64) NOT NULL,
  ItemDetailSpecification varchar(64) NOT NULL,
  Weight char(16) NOT NULL,
  NetWeight char(16) NOT NULL,
  WeightUOMCode char(16) NOT NULL,
  Volume char(16) NOT NULL,
  VolumeUOMCode char(16) NOT NULL,
  Length char(16) NOT NULL,
  Width char(16) NOT NULL,
  Height char(16) NOT NULL,
  DimensionUOMCode char(16) NOT NULL,
  ValidEndDate varchar(32) DEFAULT NULL,
  DrawingNumber varchar(16) NOT NULL,
  LotControlIndicator varchar(16) NOT NULL,
  ProcurementLeadTime varchar(32) NOT NULL,
  LotSize varchar(16) NOT NULL,
  MainCustomerID char(64) NOT NULL,
  MainVendorID char(54) NOT NULL,
  SafetyStock varchar(16) NOT NULL,
  MaximumStockLevel varchar(16) NOT NULL,
  RecieptWarehouseID varchar(64) NOT NULL,
  IssueWarehouseID varchar(64) NOT NULL,
  ABCClass varchar(16) NOT NULL,
  BackFlushedIndicator varchar(16) NOT NULL,
  ReplacementItemID char(64) NOT NULL,
  IncomingInspectionIndicator varchar(16) NOT NULL,
  FinalInspectionIndicator varchar(16) NOT NULL,
  OutgoingInspectionIndicator varchar(16) NOT NULL
);


drop table if exists V2_LINE_ROUTING;
CREATE TABLE IF NOT EXISTS V2_LINE_ROUTING (
  RoutingID varchar(64) DEFAULT NULL,
  RoutingName varchar(64) DEFAULT NULL,
  ItemID varchar(64) NOT NULL,
  OperationID char(64) NOT NULL,
  OperationSequence char(16) NOT NULL,
  LastOperationIndicator char(16) NOT NULL,
  UseIndicator varchar(16) DEFAULT NULL,
  SetupTime varchar(32) NOT NULL,
  RunTime varchar(32) NOT NULL,
  MoveTime varchar(32) NOT NULL
);


drop table if exists v2_andon;
CREATE TABLE IF NOT EXISTS v2_andon (
  AndonID bigint NOT NULL,
  GroupID varchar(64) NOT NULL,
  OperationID varchar(64) DEFAULT NULL,
  StartDateTime varchar(32) DEFAULT NULL,
  CauseNO varchar(64) DEFAULT NULL,
  CauseName varchar(128) DEFAULT NULL,
  LineStopType varchar(64) DEFAULT NULL,
  LineStopName varchar(128) DEFAULT NULL,
  TypeCode varchar(64) DEFAULT NULL,
  TypeName varchar(128) DEFAULT NULL,
  EndDateTime varchar(32) NOT NULL,
  EventDateTime varchar(32) NOT NULL
);


drop table if exists v2_productionorder;
CREATE TABLE IF NOT EXISTS v2_productionorder (
  ProductionOrderID varchar(64) DEFAULT NULL,
  ProductionOrderSequence varchar(16) NOT NULL,
  ItemID varchar(64) NOT NULL,
  ItemUOMCode varchar(16) NOT NULL,
  ProductionOrderQuantity varchar(16) DEFAULT NULL,
  ProductionDueDateTime varchar(32) DEFAULT NULL,
  ScheduleStartDateTime varchar(32) DEFAULT NULL,
  ScheduleEndDateTime varchar(32) DEFAULT NULL,
  SalesDocumentNumber varchar(16) NOT NULL,
  SalesDocumentSequence varchar(16) NOT NULL,
  OperationID varchar(64) NOT NULL
);


drop table if exists v2_productionperformance;
CREATE TABLE IF NOT EXISTS v2_productionperformance (
  ProductionPerformanceID varchar(64) DEFAULT NULL,
  ProductionPerformanceSequence varchar(16) NOT NULL,
  ProductionOrderID varchar(64) DEFAULT NULL,
  ProductionOrderSequence varchar(16) NOT NULL,
  ItemID varchar(64) NOT NULL,
  ItemUOMCode varchar(16) NOT NULL,
  ProducedQuantity varchar(16) DEFAULT NULL,
  DefectQuantity varchar(16) DEFAULT NULL,
  OperationID varchar(64) NOT NULL,
  OperationSequence varchar(16) NOT NULL,
  PersonnelID char(64) NOT NULL,
  ExecutionStartDateTime varchar(32) NOT NULL,
  ExecutionEndDateTime varchar(32) NOT NULL,
  CancelIndicator char(16) NOT NULL,
  CancelDateTime char(32) NOT NULL,
  LotID varchar(64) DEFAULT NULL,
  BatchID varchar(64) DEFAULT NULL
);



drop table if exists v2_productionplanning;
CREATE TABLE IF NOT EXISTS v2_productionplanning (
  ProductionPlanID varchar(64) DEFAULT NULL,
  ItemID varchar(64) NOT NULL,
  ProductionPlanQuantity varchar(16) DEFAULT NULL,
  ScheduleStartDateTime varchar(32) DEFAULT NULL,
  ScheduleEndDateTime varchar(32) DEFAULT NULL
);


drop table if exists v2_repair;
CREATE TABLE IF NOT EXISTS v2_repair (
  RepairID bigint NOT NULL,
  GroupID varchar(64) NOT NULL,
  DefectRegOperationID varchar(64) NOT NULL,
  DefectRegEquipmentID varchar(64) NOT NULL,
  DefectRegDateTime varchar(32) DEFAULT NULL,
  RepairDateTime varchar(32) DEFAULT NULL,
  ProductionItemSerialNO varchar(32) NOT NULL,
  DetectedProcess varchar(64) NOT NULL,
  InitialDefectLevel1 varchar(100) DEFAULT NULL,
  InitialDefectLevel2 varchar(100) DEFAULT NULL,
  InitialDefectLevel3 varchar(100) DEFAULT NULL
);

